import { Carousel } from 'antd';

import './style.css'

const contentStyle = {
  
  height: '160px',
  width:'20px',
  color: 'black',
  lineHeight: '160px',
  textAlign: 'center',
  background: 'black',
};

const PositionCarousel = () => {
  return(
    <Carousel autoplay>
    <div className='swiper-lazy'>
      <h3 style={contentStyle}>1111111111111111</h3>
    </div>

  </Carousel>
  )
}

export default PositionCarousel
